"/SENTRY/X/microsoftSharepoint2019/description" = { REPLACE = "Microsoft SharePoint 2019 Monitoring====================================Provides monitoring of Microsoft SharePoint:* SharePoint Event Logs* Performance Metrics* Windows SharePoint Processes* Windows SharePoint Services* SharePoint Components - Databases, Sites, Farms, Servers, Service Applications etc.Using the Template* Add the SharePoint server under the hosts tab and define the system type as `Windows`.* Provide appropriate username and password for System Credentials to access the server.* Also provide Site Admin Credentials if the user name to access the Admin Site is different from the System Credentials." },
